create table car_sales (
	id INT,
	uuid VARCHAR(50),
	firstName VARCHAR(50),
	lastName VARCHAR(50),
	age INT,
	gender VARCHAR(50),
	postalCode VARCHAR(50),
	country VARCHAR(50),
	phoneNr VARCHAR(50),
	emailAddress VARCHAR(50),
	creditCardNumber VARCHAR(50),
	currency VARCHAR(50),
	creationDate DATE,
	creationTimestamp VARCHAR(50),
	ipAddress VARCHAR(20),
	accountActive VARCHAR(50),
	website VARCHAR(1000),
	carBrand VARCHAR(50),
	carModel VARCHAR(50),
	productionYear VARCHAR(50),
	carUsage VARCHAR(50),
	kilometers INT,
	price VARCHAR(50),
	attachment VARCHAR(50)
);
